import React from "react"
import styled from "styled-components"
 
const Pagination = () => {
    return(
        <Div>
            <PBtn>{'<'} Anterior</PBtn>

            <div style={{display: 'flex', justifyContent: 'space-between'}}>
                <PNumber>1</PNumber>
                <PNumber>2</PNumber>
                <PNumber>3</PNumber>
                <PNumber>4</PNumber>
                <PNumber>5</PNumber>
                <PNumber>6</PNumber>
                <PNumber>7</PNumber>
                <PNumber>8</PNumber>
                <PNumber style={{margin: '0px'}}>9</PNumber>
            </div>

            <PBtn>PrÃ³xima {'>'}</PBtn>
        </Div>
    )
}

const Div = styled.div`
    display: flex;
    justify-content: space-evenly;
    width: 100%;
    margin-top: 40px;
`

const PBtn = styled.p`
    padding: 10px 20px 10px 20px;
    background-color: #32384d;
    cursor: pointer;
    border-radius: 10px;
    color: white;
    display: flex;
    justify-content: center;
    align-items: center;
`

const PNumber = styled.p`
    padding: 10px;
    background-color: #32384d;
    cursor: pointer;
    border-radius: 10px;
    color: white;
    margin-right: 10px;
    height: 40px;
    width: 40px;
    display: flex;
    justify-content: center;
    align-items: center;
`

export default Pagination
